INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (62, 1, "2030/01/01 14:59:59", 1000001, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, 3.414, -416.5, "カリン", 2, 190801, 1, "2025/01/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (62, 2, "2030/01/01 14:59:59", 1000002, "ミッションをクリアして、\n報酬をゲットしましょう！", 1, 3.099, -416.5, "カリン", 2, 190801, 1, "2025/01/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (63, 3, "2030/01/01 14:59:59", 1000003, "受け取ることができる\n報酬があるようです\n確認してみてください", 1, 2.801, -416.5, "カリン", 2, 190801, 1, "2025/01/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (63, 4, "2030/01/01 14:59:59", 1000004, "報酬がもらえますよ！\nチェックしてみてください", 2, 0.0, -416.5, "カリン", 2, 190801, 1, "2025/01/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (64, 5, "2030/01/01 14:59:59", 1000005, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 2, 2.12, -363.0, "カリン", 1, 190801, 1, "2025/01/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (64, 6, "2030/01/01 14:59:59", 1000006, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1, 1.68, -363.0, "カリン", 2, 190801, 1, "2025/01/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (64, 7, "2030/01/01 14:59:59", 1000007, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 2, 2.33, -363.0, "カリン", 1, 190801, 1, "2025/01/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 101, "2030/01/01 14:59:59", 1020101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 3, 5.18, -285.0, "ラビリスタ", 7, 133701, 10201, "2025/01/31 12:00:00", -6.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 201, "2030/01/01 14:59:59", 1020102, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 1, 8.77, -285.0, "クリスティーナ", 2, 133901, 10201, "2025/01/31 12:00:00", -2.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 301, "2030/01/01 14:59:59", 1020103, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 6, 15.5, -285.0, "ネネカ", 1, 133801, 10201, "2025/01/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 101, "2030/01/01 14:59:59", 1020201, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 2, 9.061, -285.0, "ランファ", 5, 134301, 10202, "2025/02/28 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 201, "2030/01/01 14:59:59", 1020202, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 1, 7.699, -285.0, "チカ", 2, 134401, 10202, "2025/02/28 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 101, "2030/01/01 14:59:59", 1020301, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 1, 8.595, -285.0, "アオイ", 2, 134601, 10203, "2025/03/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 201, "2030/01/01 14:59:59", 1020302, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 1, 7.758, -285.0, "クローチェ", 2, 134501, 10203, "2025/03/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 101, "2030/01/01 14:59:59", 1020401, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 2, 7.0, -285.0, "ルイズマリー", 6, 132302, 10204, "2025/04/30 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 201, "2030/01/01 14:59:59", 1020402, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 1, 7.904, -285.0, "イロハ", 2, 132402, 10204, "2025/04/30 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 301, "2030/01/01 14:59:59", 1020403, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 4, 8.487, -285.0, "ソノ", 2, 132502, 10204, "2025/04/30 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 101, "2030/01/01 14:59:59", 1020502, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 1, 8.763, -285.0, "カノン", 2, 134901, 10205, "2025/05/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 201, "2030/01/01 14:59:59", 1020503, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 1, 6.417, -285.0, "ツムギ", 3, 134801, 10205, "2025/05/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 101, "2030/01/01 14:59:59", 1020601, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 3, 10.335, -285.0, "エリス", 7, 135001, 10206, "2025/06/30 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 201, "2030/01/01 14:59:59", 1020602, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 2, 6.281, -285.0, "シェフィ", 4, 135101, 10206, "2025/06/30 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 301, "2030/01/01 14:59:59", 1020603, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 1, 12.244, -285.0, "プレシア", 2, 135201, 10206, "2025/06/30 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 101, "2030/01/01 14:59:59", 1020701, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 2, 6.339, -285.0, "クリア", 8, 135301, 10207, "2025/07/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 201, "2030/01/01 14:59:59", 1020702, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 7, 8.184, -285.0, "アネモネ", 9, 135401, 10207, "2025/07/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 101, "2030/01/01 14:59:59", 1020801, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 9, 3.906, -285.0, "アイラ", 2, 129101, 10208, "2025/08/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 201, "2030/01/01 14:59:59", 1020802, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 1, 14.465, -285.0, "シナツ", 2, 129201, 10208, "2025/08/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 301, "2030/01/01 14:59:59", 1020803, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 4, 8.662, -285.0, "ヒヨリ", 3, 100101, 10208, "2025/08/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 401, "2030/01/01 14:59:59", 1020804, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 1, 10.915, -285.0, "レイ", 3, 100301, 10208, "2025/08/31 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 101, "2030/01/01 14:59:59", 1020901, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 1, 6.042, -285.0, "ユキノ", 7, 135802, 10209, "2025/09/30 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 201, "2030/01/01 14:59:59", 1020902, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 4, 9.402, -285.0, "サツキ", 1, 135903, 10209, "2025/09/30 12:00:00", 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (61, 301, "2030/01/01 14:59:59", 1020903, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 8, 8.16, -285.0, "ルルィ", 1, 136902, 10209, "2025/09/30 12:00:00", 0.0);
